const mongoose = require('mongoose')
const slugify = require('slugify')
const UserSchema = new mongoose.Schema({
    name:{
        type: String,
        required: true,
        unique: true
    },
    email:{
        type: String,
        required: true,
        unique: true
    },
    password:{
        type: String,
        required: true
    },
    avatar:{
        type: String,
        default: "data:image/jpeg;base64,"
    },
    friends:[
        {
            user:{
                type: mongoose.Schema.Types.ObjectId,
                ref: "User"
            },
            name:{
                type: String,
                required: true
            },
            avatar:{
                type: String
            },
            date:{
                type: Date,
                default: Date.now
            }
        }
    ],
    hold_friend:[
        {
            user:{
                type: mongoose.Schema.Types.ObjectId,
                ref: "User"
            },
            name:{
                type: String,
                required: true
            },
            avatar:{
                type: String
            },
            date:{
                type: Date,
                default: Date.now
            }
        }
    ],
    date:{
        type: Date,
        default: Date.now
    }
})
UserSchema.pre("validate", function(next) {
    if(this.name){
        this.name = slugify(this.name, {
            strict: true
        })
    }
    next()
})
module.exports = User = mongoose.model('User', UserSchema);